import axios from "axios"
import cookies from "js-cookie"

export const fetchUserData = async(dispatch, getState)=>{
    const response = await axios.get("http://192.168.1.247:3001/api/user", {
        headers: {
            //"customHeader": "test"
        }
    })
    .then(res=>{
        const user = res.data
        dispatch({
            type: "FETCH_USER_SUCCESS",
            payload: res.data
        })
    })
}

export const fetchUserAuth = async(dispatch, getState)=>{
    await axios.get("http://192.168.1.247:3001/api/user/auth", {
        headers: {
            //"customHeader": "test"
        },
        data: {
            cookie: cookies
        }
    })
    .then(res=>{
        dispatch({
            type: "FETCH_USER_CHECK",
        })
    })
}

export const authSucess = (dispatch)=>{
    dispatch({
        type: "AUTH_SUCCESS"
    })
}

export const authCheck = (dispatch)=>{
    dispatch({
        type: "AUTH_CHECK"
    })
}
